create table route
(
    id            varchar(36)  not null
        primary key,
    end_station   varchar(255) null,
    start_station varchar(255) null
)
        engine = InnoDB;







create table route_distances
(
    route_id        varchar(36) not null,
    distances       int         null,
    distances_order int         not null,
    primary key (route_id, distances_order)
)
        engine = InnoDB;







create table route_stations
(
    route_id       varchar(36)  not null,
    stations       varchar(255) null,
    stations_order int          not null,
    primary key (route_id, stations_order)
)
        engine = InnoDB;























